import {Typography} from '@mui/material';
import {Container} from '@mui/system';
import React from 'react';

const About = () => {
   return (
      <Container maxWidth="lg" sx={{minHeight: '90vh'}}>
         <Typography variant="h5"> About this app</Typography>
         <Typography>
            This is a React Typescript based Todo list app. The following
            technologies has been used to build this app: - React library -
            Typescript - Redux Toolkit - Material UI - Masonry component from
            Material Lab package - React Router Dom
         </Typography>
      </Container>
   );
};

export default About;
